ls -->\n        <a class="left carousel-control" href="#carousel-example-generic" data-slide="prev">\n            <span class="fa fa-angle-left"></span>\n        </a>\n        <a class="right carousel-control" href="#carousel-example-generic" data-slide="next">\n            <span class="fa fa-angle-right"></span>\n        </a>\n    </div>\n</div>\n\n<!--<app-autocomplete></app-autocomplete>-->\n<div class="container">\n    <div class="title-card">\n        <div class="row">\n            <div class="col-sm-9">\n                <h3 class="title-bold">\n                    <a class="text-primary">Recommended for you</a>\n                </h3>\n            </div>\n            <div class="col-sm-3 btn-more">\n                <a class="btn" [routerLink]="[\'/recommendations\']" [queryParams]="{\'sort\':\'created\'}">\n          See all\n        </a>\n            </div>\n        </div>\n    </div>\n    <div class="row">\n        <div class="col-sm-4" *ngFor="let challenge of recommendedChallenges">\n            <app-card-challenge [challenge]=\'challenge\'></app-card-challenge>\n        </div>\n    </div>\n</div>\n<div class="container">\n    <div class="title-card">\n        <div class="row">\n            <div class="col-sm-9">\n                <h3 class="title-bold">\n                    <a class="text-primary">What is popular</a>\n                </h3>\n            </div>\n            <div class="col-sm-3 btn-more">\n                <a class="btn" [routerLink]="[\'/challenges\']" [queryParams]="{\'sort\':\'popular\'}">\n          See all\n        </a>\n            </div>\n        </div>\n    </div>\n    <div class="row">\n        <div class="col-sm-4" *ngFor="let challenge of popularChallenges">\n            <app-card-challenge [challenge]=\'challenge\'></app-card-challenge>\n        </div>\n    </div>\n</div>\n'},862:function(e,t){e.exports="<p>\n  notifications works!\n</p>\n"},863:function(e,t){e.exports="<p>\n  profiles works!\n</p>\n"}},[1128]);